import React from 'react';
import {Container, Card, Row, Col} from 'react-bootstrap';
import Depan from '../component/utama.jpg';

export default function HalamanUtama(){
	return(

		<>
		<Container fluid>
		  <Row>
		    <div style={{position: 'relative', textAlign: 'center', color: 'black'}}>
		    <img src={Depan} style={{width: '100%'}} />
		    <p style={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)'}}><b>BIG FAMILY</b></p>
		    </div>
		  </Row>
		</Container>

		</>


		);
}
